import React, { Component } from 'react'
import { Route } from "react-router-dom";
import { ViewAT1 } from '../components/AT - Form/ViewAT1';
import { ViewAT2 } from '../components/AT - Form/ViewAT2';
import { ViewAT3 } from '../components/AT - Form/ViewAT3';
import { ViewAT4 } from '../components/AT - Form/ViewAT4';
import { ViewAT8 } from '../components/AT - Form/ViewAT8';
import { ViewAT5 } from '../components/AT - Form/ViewAT5';
import { ViewAT7 } from '../components/AT - Form/ViewAT7';
export class ViewAT extends Component {
  render() {
    return (
      <div>
        <Route
          path={process.env.PUBLIC_URL + "/ViewAT1"}
          exact={true}
          component={ViewAT1}
        />
         <Route
          path={process.env.PUBLIC_URL + "/ViewAT8"}
          exact={true}
          component={ViewAT8}
        />
         <Route
          path={process.env.PUBLIC_URL + "/ViewAT5"}
          exact={true}
          component={ViewAT5}
        />
         <Route
          path={process.env.PUBLIC_URL + "/ViewAT7"}
          exact={true}
          component={ViewAT7}
        />
        <Route
          path={process.env.PUBLIC_URL + "/ViewAT2"}
          exact={true}
          component={ViewAT2}
        />
        <Route
          path={process.env.PUBLIC_URL + "/ViewAT3"}
          exact={true}
          component={ViewAT3}
        />
        <Route
          path={process.env.PUBLIC_URL + "/ViewAT4"}
          exact={true}
          component={ViewAT4}
        />
      </div>
    )
  }
}

export default ViewAT
